import React, { useState, useEffect } from 'react';
import axios from 'axios';
import { Container, Typography, Grid, Card, CardContent, Button, CircularProgress, Box, TextField, Select, MenuItem, InputLabel, FormControl, FormHelperText, createTheme, ThemeProvider } from '@mui/material';
import { green, red, yellow, blueGrey } from '@mui/material/colors';

// Criando um tema escuro com o Material-UI
const theme = createTheme({
  palette: {
    mode: 'dark',  // Modo escuro
    primary: {
      main: blueGrey[700],
    },
    secondary: {
      main: green[500],
    },
    background: {
      default: '#121212', // Fundo escuro
      paper: '#1c1c1c', // Fundo das cartas
    },
    text: {
      primary: '#e0e0e0', // Texto principal claro
      secondary: '#757575', // Texto secundário cinza claro
    },
  },
});

function App() {
  const [status, setStatus] = useState([]);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState(null);
  const [preferredEnergySource, setPreferredEnergySource] = useState('');
  const [preferredTime, setPreferredTime] = useState('');

  useEffect(() => {
    axios.get('http://localhost:5000/api/status')
      .then((response) => {
        setStatus(response.data);
        setLoading(false);
      })
      .catch((error) => {
        setError('Erro ao carregar os dados');
        setLoading(false);
      });
  }, []);

  const handleEnergySourceChange = (event) => {
    setPreferredEnergySource(event.target.value);
  };

  const handleTimeChange = (event) => {
    setPreferredTime(event.target.value);
  };

  const getStatusColor = (status) => {
    switch (status) {
      case 'Carregando':
        return green[500];
      case 'Concluído':
        return yellow[700];
      case 'Erro':
        return red[500];
      default:
        return '#e0e0e0';
    }
  };

  return (
    <ThemeProvider theme={theme}>
      <Container maxWidth="lg" sx={{ padding: '20px' }}>
        <Typography variant="h3" gutterBottom align="center" color="primary">
          Monitoramento de Recarga de Veículos Elétricos
        </Typography>

        {loading ? (
          <CircularProgress color="secondary" />
        ) : error ? (
          <Typography color="error" align="center">
            {error}
          </Typography>
        ) : (
          <Grid container spacing={3} justifyContent="center">
            {status.map((veiculo, index) => (
              <Grid item xs={12} sm={6} md={4} key={index}>
                <Card variant="outlined" sx={{ backgroundColor: '#1c1c1c', boxShadow: '0 4px 10px rgba(0, 0, 0, 0.5)' }}>
                  <CardContent>
                    <Typography variant="h5" component="div" color="primary">
                      {veiculo.nome}
                    </Typography>
                    <Typography variant="body2" color={getStatusColor(veiculo.status)}>
                      Status: {veiculo.status}
                    </Typography>
                    <Typography color="textSecondary">
                      Fonte de Energia: {veiculo.fonteEnergia}
                    </Typography>
                    <Typography color="textSecondary">
                      Hora de Início: {veiculo.horaInicio}
                    </Typography>
                    <Button variant="contained" color="secondary" fullWidth>
                      Detalhes
                    </Button>
                  </CardContent>
                </Card>
              </Grid>
            ))}
          </Grid>
        )}

        {/* Seção de Personalização */}
        <Box mt={5} textAlign="center">
          <Typography variant="h5" gutterBottom color="textPrimary">
            Personalizar Preferências de Carregamento
          </Typography>

          <Grid container spacing={3} justifyContent="center">
            <Grid item xs={12} sm={6} md={4}>
              <FormControl fullWidth>
                <InputLabel>Fonte de Energia</InputLabel>
                <Select
                  value={preferredEnergySource}
                  onChange={handleEnergySourceChange}
                  label="Fonte de Energia"
                  sx={{ backgroundColor: '#424242', color: '#fff' }}
                >
                  <MenuItem value="solar">Solar</MenuItem>
                  <MenuItem value="eolica">Eólica</MenuItem>
                  <MenuItem value="hidraulica">Hidráulica</MenuItem>
                  <MenuItem value="convencional">Convencional</MenuItem>
                </Select>
                <FormHelperText sx={{ color: 'white' }}>
                  Escolha uma fonte renovável ou convencional
                </FormHelperText>
              </FormControl>
            </Grid>

            <Grid item xs={12} sm={6} md={4}>
              <TextField
                fullWidth
                label="Horário Preferencial"
                type="time"
                value={preferredTime}
                onChange={handleTimeChange}
                InputLabelProps={{
                  shrink: true,
                }}
                sx={{
                  backgroundColor: '#424242',
                  color: '#fff',
                }}
              />
            </Grid>
          </Grid>
        </Box>
      </Container>
    </ThemeProvider>
  );
}

export default App;
